{
  "name": "UBX-LOG-BATCH",
  "class_id": "0x21",
  "message_id": "0x11",
  "description": "This message combines position, velocity and time solution, including accuracy figures. The output of this message can be requested via UBX-LOG-RETRIEVEBATCH.",
  "message_type": "output",
  "payload": {
    "length": {
      "fixed": 100
    },
    "fields": [
      {
        "name": "version",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "name": "contentValid",
        "byte_offset": 1,
        "data_type": "X1",
        "description": "Content validity flags",
        "bitfield": {
          "bits": [
            {
              "name": "extraPvt",
              "bit_start": 0,
              "bit_end": 0,
              "description": "Extra PVT information is valid. The fields iTOW, tAcc, numSV, HMSL, vAcc, velN, velE, velD, sAcc, headAcc and PDOP are only valid if this flag is set."
            },
            {
              "name": "extraOdo",
              "bit_start": 1,
              "bit_end": 1,
              "description": "Odometer data is valid. The fields distance, totalDistance and distanceStd are only valid if this flag is set. Note: the odometer feature itself must also be enabled."
            }
          ]
        }
      },
      {
        "name": "msgCnt",
        "byte_offset": 2,
        "data_type": "U2",
        "description": "Message counter; increments for each sent UBX-LOG-BATCH message."
      },
      {
        "name": "iTOW",
        "byte_offset": 4,
        "data_type": "U4",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See section Clocks and time in the integration manual for description of navigation epoch and iTOW. Only valid if extraPvt is set."
      },
      {
        "name": "year",
        "byte_offset": 8,
        "data_type": "U2",
        "unit": "y",
        "description": "Year (UTC)"
      },
      {
        "name": "month",
        "byte_offset": 10,
        "data_type": "U1",
        "unit": "month",
        "description": "Month, range 1..12 (UTC)"
      },
      {
        "name": "day",
        "byte_offset": 11,
        "data_type": "U1",
        "unit": "d",
        "description": "Day of month, range 1..31 (UTC)"
      },
      {
        "name": "hour",
        "byte_offset": 12,
        "data_type": "U1",
        "unit": "h",
        "description": "Hour of day, range 0..23 (UTC)"
      },
      {
        "name": "min",
        "byte_offset": 13,
        "data_type": "U1",
        "unit": "min",
        "description": "Minute of hour, range 0..59 (UTC)"
      },
      {
        "name": "sec",
        "byte_offset": 14,
        "data_type": "U1",
        "unit": "s",
        "description": "Seconds of minute, range 0..60 (UTC)"
      },
      {
        "name": "valid",
        "byte_offset": 15,
        "data_type": "X1",
        "description": "Validity flags",
        "bitfield": {
          "bits": [
            {
              "name": "validDate",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = valid UTC Date (see section Time validity in the integration manual for details)"
            },
            {
              "name": "validTime",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = valid UTC Time of Day (see section Time validity in the integration manual for details)"
            }
          ]
        }
      },
      {
        "name": "tAcc",
        "byte_offset": 16,
        "data_type": "U4",
        "unit": "ns",
        "description": "Time accuracy estimate (UTC). Only valid if extraPvt is set."
      },
      {
        "name": "fracSec",
        "byte_offset": 20,
        "data_type": "I4",
        "unit": "ns",
        "description": "Fraction of second, range -1e9..1e9 (UTC)"
      },
      {
        "name": "fixType",
        "byte_offset": 24,
        "data_type": "U1",
        "description": "GNSSfix Type: 0 = no fix, 2 = 2D-fix, 3 = 3D-fix"
      },
      {
        "name": "flags",
        "byte_offset": 25,
        "data_type": "X1",
        "description": "Fix status flags",
        "bitfield": {
          "bits": [
            {
              "name": "gnssFixOK",
              "bit_start": 0,
              "bit_end": 0,
              "description": "1 = valid fix (i.e within DOP & accuracy masks)"
            },
            {
              "name": "diffSoln",
              "bit_start": 1,
              "bit_end": 1,
              "description": "1 = differential corrections were applied"
            },
            {
              "name": "psmState",
              "bit_start": 2,
              "bit_end": 4,
              "description": "Power save mode state (see section Power management in the integration manual for details): 0 = PSM is not active, 1 = Enabled (an intermediate state before Acquisition state), 2 = Acquisition, 3 = Tracking, 4 = Power optimized tracking, 5 = Inactive"
            }
          ]
        }
      },
      {
        "name": "flags2",
        "byte_offset": 26,
        "data_type": "X1",
        "description": "Additional flags"
      },
      {
        "name": "numSV",
        "byte_offset": 27,
        "data_type": "U1",
        "description": "Number of satellites used in Nav Solution. Only valid if extraPvt is set."
      },
      {
        "name": "lon",
        "byte_offset": 28,
        "data_type": "I4",
        "scale": {
          "raw": "1e-7",
          "multiplier": 0.0000001
        },
        "unit": "deg",
        "description": "Longitude"
      },
      {
        "name": "lat",
        "byte_offset": 32,
        "data_type": "I4",
        "scale": {
          "raw": "1e-7",
          "multiplier": 0.0000001
        },
        "unit": "deg",
        "description": "Latitude"
      },
      {
        "name": "height",
        "byte_offset": 36,
        "data_type": "I4",
        "unit": "mm",
        "description": "Height above ellipsoid"
      },
      {
        "name": "hMSL",
        "byte_offset": 40,
        "data_type": "I4",
        "unit": "mm",
        "description": "Height above mean sea level. Only valid if extraPvt is set."
      },
      {
        "name": "hAcc",
        "byte_offset": 44,
        "data_type": "U4",
        "unit": "mm",
        "description": "Horizontal accuracy estimate"
      },
      {
        "name": "vAcc",
        "byte_offset": 48,
        "data_type": "U4",
        "unit": "mm",
        "description": "Vertical accuracy estimate. Only valid if extraPvt is set."
      },
      {
        "name": "velN",
        "byte_offset": 52,
        "data_type": "I4",
        "unit": "mm/s",
        "description": "NED north velocity. Only valid if extraPvt is set."
      },
      {
        "name": "velE",
        "byte_offset": 56,
        "data_type": "I4",
        "unit": "mm/s",
        "description": "NED east velocity. Only valid if extraPvt is set."
      },
      {
        "name": "velD",
        "byte_offset": 60,
        "data_type": "I4",
        "unit": "mm/s",
        "description": "NED down velocity. Only valid if extraPvt is set."
      },
      {
        "name": "gSpeed",
        "byte_offset": 64,
        "data_type": "I4",
        "unit": "mm/s",
        "description": "Ground Speed (2-D)"
      },
      {
        "name": "headMot",
        "byte_offset": 68,
        "data_type": "I4",
        "scale": {
          "raw": "1e-5",
          "multiplier": 0.00001
        },
        "unit": "deg",
        "description": "Heading of motion (2-D)"
      },
      {
        "name": "sAcc",
        "byte_offset": 72,
        "data_type": "U4",
        "unit": "mm/s",
        "description": "Speed accuracy estimate. Only valid if extraPvt is set."
      },
      {
        "name": "headAcc",
        "byte_offset": 76,
        "data_type": "U4",
        "scale": {
          "raw": "1e-5",
          "multiplier": 0.00001
        },
        "unit": "deg",
        "description": "Heading accuracy estimate. Only valid if extraPvt is set."
      },
      {
        "name": "pDOP",
        "byte_offset": 80,
        "data_type": "U2",
        "scale": {
          "raw": "0.01",
          "multiplier": 0.01
        },
        "description": "Position DOP. Only valid if extraPvt is set."
      },
      {
        "name": "reserved0",
        "byte_offset": 82,
        "data_type": {
          "array_of": "U1",
          "count": 2
        },
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "distance",
        "byte_offset": 84,
        "data_type": "U4",
        "unit": "m",
        "description": "Ground distance since last reset. Only valid if extraOdo is set."
      },
      {
        "name": "totalDistance",
        "byte_offset": 88,
        "data_type": "U4",
        "unit": "m",
        "description": "Total cumulative ground distance. Only valid if extraOdo is set."
      },
      {
        "name": "distanceStd",
        "byte_offset": 92,
        "data_type": "U4",
        "unit": "m",
        "description": "Ground distance accuracy (1-sigma). Only valid if extraOdo is set."
      },
      {
        "name": "reserved1",
        "byte_offset": 96,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}

